import React, { useState } from "react"
function FlightComponent() {
  const [activeTab, setActiveTab] = useState(0);
  const handleTabClick = (index) => {
    setActiveTab(index);
  };
  const renderTabs = () => {
    const tabs = [];
    const values = ["Insert", "Delete", "Update", "Search", "Complex 1", "Complex 2"];
    for (let i = 0; i < 6; i++) {
      tabs.push(
        <button key={i} onClick={() => handleTabClick(i)}>
          {values[i]}
        </button>
      );
    }
    return tabs;
  };
  const renderPage = () => {
    switch (activeTab) {
      case 0:
        return (
          <div>
            <h2>User Login</h2>
            <input type="userName" placeholder="Enter username" />
            <button>Enter</button>
          </div>
        );
      case 1:
        return (
          <div>
            <h2>Delete Flight with Flight Number</h2>
            <input type="flightNum" placeholder="Enter Flight Number" />
            <button>Enter</button>
          </div>
        );
      case 2:
        return (
          <div>
            <h2>Update Flight </h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      case 3:
        return (
          <div>
            <h2>Page 4</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      case 4:
        return (
          <div>
            <h2>Page 5</h2>
            <input type="text" placeholder="Enter text" />
            <input type="text" placeholder="Enter text" />
            <button>Enter</button>
          </div>
        );
      default:
        return null;
    }
  };
  return (
    <div>
      <h1>Flight Information</h1>
      <div>{renderTabs()}</div>
      <div>{renderPage()}</div>
    </div>
  );
}
export default FlightComponent;
